// Libraries
import { Switch, Route, useHistory } from 'react-router-dom';
import React, { useState } from "react";
// import styled from 'styled-components';

// import useSessionstorage from "@rooks/use-sessionstorage";

// Components
import NotLoggedIn from './NotLoggedIn';
import LoggedIn from './LoggedIn';

function App() {
    const [session, setSession] = useState({id:0, name: "there"});

    // const [ sessionStorages, setSessionStorage, removeSessionStorage ] = useSessionStorage(["logInfo"]);
    // function setSession(newItem){ setSessionStorage("logInfo", newItem); };
    // setSession({id: 0, name: "there"});
    const history = useHistory();

    return (
        <>
        <h2>Big O Calculator</h2>
            <Switch>
                <Route exact path="/">
                    {session.id !== 0 ? <LoggedIn currentId={session.id} setSession={setSession}/> : <NotLoggedIn history={history} setSession={setSession}/>}
                </Route>
                <Route path="/user/:id/:name">
                    {session.id !== 0 ? <LoggedIn setSession={setSession}/> : <NotLoggedIn history={history} setSession={setSession}/>}
                </Route>
            </Switch>
        </>
    );
}

export default App;
